    <path
      d={`M ${-rocketSim.bodyWidth / 2} ${-rocketSim.finBaseWidth}
          L ${-rocketSim.bodyWidth / 2} ${0}
          L ${-rocketSim.bodyWidth / 2 - rocketSim.finHeight} ${rocketSim.finSweepLength}
          L ${-rocketSim.bodyWidth / 2 - rocketSim.finHeight} ${rocketSim.finSweepLength - rocketSim.finTipWidth} Z`}
      fill="#6B7280"
      stroke="#374151"
      strokeWidth="1.5"
    />

    {/* 右フィン - 縦向きに修正 */}
    <path
      d={`M ${rocketSim.bodyWidth / 2} ${-rocketSim.finBaseWidth}
          L ${rocketSim.bodyWidth / 2} ${0}
          L ${rocketSim.bodyWidth / 2 + rocketSim.finHeight} ${rocketSim.finSweepLength}
          L ${rocketSim.bodyWidth / 2 + rocketSim.finHeight} ${rocketSim.finSweepLength - rocketSim.finTipWidth} Z`}
      fill="#6B7280"
      stroke="#374151"
      strokeWidth="1.5"
    />

    {/* センターフィン - 縦向きに修正 */}
    <rect
      x={-rocketSim.finThickness / 2}
      y={-rocketSim.finBaseWidth}
      width={rocketSim.finThickness}
      height={rocketSim.finBaseWidth + Math.max(0, rocketSim.finSweepLength)}
      fill="#6B7280"
      stroke="#374151"
      strokeWidth="1.5"
    />

    {/* 重心マーカー */}
    <line
      x1={-60}
      y1={-rocketSim.bodyHeight + rocketSim.centerOfGravity}
      x2={60}
      y2={-rocketSim.bodyHeight + rocketSim.centerOfGravity}
      stroke="#EF4444"
      strokeWidth="2.5"
    />

    {/* 圧力中心マーカー */}
    <line
      x1={-60}
      y1={-rocketSim.bodyHeight + rocketSim.calculations.pressureCenter}
      x2={60}
      y2={-rocketSim.bodyHeight + rocketSim.calculations.pressureCenter}
      stroke="#3B82F6"
      strokeWidth="2"
      strokeDasharray="6,3"
    />

    {/* 静安定マージン用圧力中心マーカー */}
    <line
      x1={-60}
      y1={-rocketSim.bodyHeight + rocketSim.calculations.stabilityCenterOfPressure}
      x2={60}
      y2={-rocketSim.bodyHeight + rocketSim.calculations.stabilityCenterOfPressure}
      stroke="#10B981"
      strokeWidth="2"
      strokeDasharray="3,3"
    />
  </g>
</svg>
          </div>
        </div>
      </div>
    </div>
  );
};
